import React, { Component } from 'react';

class WineBars extends Component {
    constructor(props){
        super();
        this.state = {
            data: [],
            zipCode: '94109'
        }
    }
    componentDidMount(){
        axios.get("/winebars", {params: { zipCode: this.state.zipCode} })
        .then((response) => {
            this.setState({data: response.data})
            console.log(this.state.data);
        })
        .catch((error) => {
            console.log(error);
        })
    }

    render() {
        return (
            <div>
                {/* {this.state.data.map((item, i) => {
